module.exports = "<app-navbar [admin]=\"admin\"></app-navbar>\r\n<router-outlet></router-outlet>\r\n<ng-template #content let-c=\"close\" let-d=\"dismiss\">\r\n  <div class=\"modal-header\">\r\n    <h4 class=\"modal-title\">\r\n      Informationen zu statistischen Geschwindigkeitserhebungen des Kantons Basel-Stadt\r\n    </h4>\r\n    <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"d('Cross click')\">\r\n      <span aria-hidden=\"true\">&times;</span>\r\n    </button>\r\n  </div>\r\n  <div class=\"modal-body\">\r\n    <p>Die Visualisierung der Geschwindigkeitserhebungen basiert auf Messdaten der <a href=\"http://www.polizei.bs.ch/\" target=\"_blank\">Kantonspolizei Basel-Stadt</a>, welche zu statistischen Zwecken erhoben wurden. Die Daten wurden im Rahmen eines Open Government Data Pilotprojektes von der <a target=\"_blank\" href=\"http://www.digitale-nachhaltigkeit.unibe.ch/\">Forschungsstelle Digitale Nachhaltigkeit</a> der Universität Bern visualisiert.</p>\r\n\r\n    <ul>\r\n      <li>\r\n        Die Punkte auf der Karte bilden die Übertretungsquote in der jeweiligen Strasse ab.\r\n        Die Farben repräsentieren die folgenden Kategorien:\r\n        <br>\r\n        <svg width=\"15\" height=\"15\">\r\n          <rect x=\"0\" y=\"0\" width=\"15\" height=\"15\" style=\"fill:#ffff00;stroke:black;stroke-width:2;stroke-opacity:0.9\" />\r\n        </svg> Übertretungsquote zwischen 0 und 10%\r\n        <br>\r\n        <svg width=\"15\" height=\"15\">\r\n          <rect x=\"0\" y=\"0\" width=\"15\" height=\"15\" style=\"fill:#ffa500;stroke:black;stroke-width:2;stroke-opacity:0.9\" />\r\n        </svg> Übertretungsquote zwischen 11% und 25%\r\n        <br>\r\n        <svg width=\"15\" height=\"15\">\r\n          <rect x=\"0\" y=\"0\" width=\"15\" height=\"15\" style=\"fill:#d73027;stroke:black;stroke-width:2;stroke-opacity:0.9\" />\r\n        </svg> Übertretungsquote höher als 25%\r\n      </li>\r\n      <li>\r\n        Durch näheres Heranzoomen erscheinen in der Karte statt der Punkte Pfeile für die einzelnen Richtungen.\r\n      </li>\r\n      <li>\r\n        Für jeden Punkt bzw. Pfeil sind in einem Anzeigefeld weitere Informationen (wie die Anzahl gemessener Fahrzeuge und die Durchschnittsgeschwindigkeit) einsehbar.\r\n      </li>\r\n      <li>\r\n        Durch Klicken auf einen Punkt bzw. Pfeil erscheint ein Säulendiagramm, welches die Messungen für einzelne Wochentage zeigt. Wird auf die Säule für einen Wochentag geklickt, erscheint ein weiteres Diagramm, in dem die Messungen pro Stunde an einem Tag angegeben werden. Die Farbe der Säulen bildet die Anzahl gemessener Fahrzeuge ab.\r\n      </li>\r\n    </ul>\r\n\r\n  </div>\r\n  <div class=\"modal-footer\">\r\n    <button type=\"button\" class=\"btn btn-light\" (click)=\"c('Close click')\">Schliessen</button>\r\n  </div>\r\n</ng-template>\r\n<button class=\"btn btn-primary m-2 p-2 px-3 infoBtn\" id=\"openModal\" (click)=\"openLg(content)\">i</button>\r\n\r\n"

